package springproject.msuser.entity;import lombok.AllArgsConstructor;import lombok.Builder;import lombok.Data;import lombok.NoArgsConstructor;import javax.persistence.*;import java.io.Serializable;import java.util.List;@Entity@Table(name = "users")@Data@NoArgsConstructor@AllArgsConstructor@Builderpublic class User implements Serializable {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    @Column(unique = true)    private String username;    @Column(length = 100)    private String password;    private Boolean enabled;    private String name;    @Column(unique = true)    private String email;    @ManyToMany(fetch = FetchType.LAZY)    private List<Role> roles;}